import React from "react";
import { Switch } from "react-router-dom";
import Home from '../Home/Home.js'
import { Route } from 'react-router-dom'

const Routes = () => {
    <Switch>
        <Route path="/" exact component={Home}/>
    </Switch>
}

export default Routes;
